import React from 'react';
import {MapTo} from '@adobe/aem-react-editable-components';
require('./Banner.css');

export const CustomEditConfig = {
       emptyLabel: 'Banner',

       isEmpty: function(props) {
       console.log('Props:', props);
          console.log('Banner Image:', props.bannerImg);
          console.log('Checking if props are empty:', !props || !props.banner_img);
         return !props || !props.bannerImg;
       }
};

export default function Banner(props){
console.log('Banner props:', props);  // Log props to check their values

    if (CustomEditConfig.isEmpty(props)) {

        return null;
    }
    console.log('Rendering Banner component');
    return (
    	<section className="banner">
    	    <div className="bannerImg">
                <a  href="#"><img src={props.bannerImg} alt="Banner Image"/></a>
                    <div className="text-box">
                        <h1>{props.title}</h1>
                        <p>{props.bannerText}</p>
                        <a href={props.btnLink} className="hero-btn">{props.btnTitle}</a>
                    </div>
            </div>
    	</section>

    );
};




MapTo('spa-react/components/content/baner')(Banner,CustomEditConfig);
